<P>따라서 성품이 자상하고 다정다감한 내성을 타고 났습니다. 평생 의식은 풍요하나 매사에 분명<BR>하고 호인인 듯해도 처음에는 쉽게 친하기 어려운 냉정함이 깃들어 있기도 합니다. </P>', 'H04', '18');<P>참을성이 강한 반면에 사소한 부분에 민감하게 반응할 수 있는데, 대체적으로 프라이버시나 컴<BR>플렉스, 인간적인 면에서의 배신과 같은 입장에서는 아무리 사소한 것이라 해도 민감한 반응을<BR>보일 수 있겠습니다. <BR></P>', 'B08', '22');<P>&nbsp;</P>', 'D10', '24');<P>&nbsp;</P>', 'E11', '25');<P>대체적으로 초반보다 중반 이후나 후반부 부터 컨디션을 회복하는 편으로 늦게 시동이 걸리는 <BR>특징이 예상됩니다. </P>', 'J10', '60');