 insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '내적인 경향이 강하게 나타므로 외로움을 타면서도 쉽게 속내를 털어내지 못하는 외부에 대한 <BR>경계가 있다 하겠으며 다소 중성적인 매력을 보이기도 합니다. 한 곳에 집중하면 나머지를 잊<BR>어버리는 순간적인 집중력도 강한 편이지만 그럴 필요가 없을 때면 산만함도 곧잘 나타납니다.', 'A11', '1');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '<P>다소 눈이 높은 편이라 할 수 있지만 정작 스스로는 그다지 따지는 편은 아니라 여기는 경우가<BR>많습니다. 다소 원칙적인 면과 꼼꼼한 습성이 있기 때문에 까다롭기도 하지만 배려도 세심한 <BR>편입니다. </P>', 'B12', '2');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '평소에는 조용하고 섬세한 듯 한 면을 보이기도 하지만 상황에 따라선 매우 급한 양극의 성격<BR>이라 할 수 있겠습니다. 감수성이 예민한 편이며 자존심이 강하기 때문에 사람앞에서 감정을<BR>드러내는 것은 꺼리는 경우도 있습니다. ', 'C01', '3');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '외골수이거나 다소 엉뚱한 면이 엿보이는 독특한 개성이 있다 할 수 있으며 털털해 보일 때도<BR>있지만 이지적이고 고상해 보이는 이미지로 인해 사람들이 대하기 어려워 하기도 합니다.<BR><BR>', 'D02', '4');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '조심스럽고 신중한 면도 있는가 하면 과격하고 성급한 양극적인 면이 내재되어 있다 할 수 있<BR>습니다. 주변 사람들과 어울리기 좋아하는 편이지만 약간 결벽스러운 면이 있기 때문에 자신과<BR>거리가 먼 사람에 대해서는 경계하는 편이기도 합니다. ', 'E03', '5');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '낮가림이 좀 있는 편이며 자기 방어적인 부분이 많다 할 수 있겠습니다. 그러나 편해지면 의외<BR>로 낙천적이고 활달한 모습을 보이기도 하는 다소 조심성이 있는 성품이라 할 수 있겠습니다. <BR>외로움을 많이 타는 편이면서도 쉽게 사람들에게 다가서려 하지 않지만 한 번 정을 주면 깊게<BR>믿는 편이라 할 수 있겠습니다. <BR>', 'F04', '6');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '싱글일 때는 보수적이기도 하며 방어적인 기질때문에 쉽게 다가서기 어려울 것 같은 이미지를<BR>어필하는 편이지만 꼭히 그렇지만은 않은 편이며, 친해 질수록 구김이 없는 밝은 성품이기 때<BR>문에 화합이 쉬운 편입니다. 그러나 반대로 한 번 아니라 생각하면 돌이키기 어려운 면도 있<BR>다 하겠습니다. ', 'G05', '7');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '꼼꼼한 기질을 발휘할 때에는 주변에서 뭐라 해도 신경 않 쓸 정도의 강한 순간적인 집중력을<BR>보여 주기도 하지만 산만해 지기 시작하면 엉뚱한 대답을 하거나 귀찮아 하기도 하는 양극의<BR>변화를 보이기도 합니다. 대체적으로 다양한 분야에 식견을 갖춘 경우가 많은 편이므로 한 분<BR>야에 꾸준히 노력한다면 큰 성과를 거둘만 합니다. ', 'H06', '8');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '다소 괴팍한 면도 있겠습니다. 활달한 면과 함께 감수성이 예민한 편이기 때문에 때로는 내성<BR>적인 면을 보이기도 합니다. 이러한 양극적인 모습은 이성에게 어린 듯한 모습이나 중성적인<BR>듯한 면을 어필하면서 사랑을 요구하는 본성으로 나타납니다. 대체적으로 자신의 일에 대한 자<BR>부심과 외골수적인 면이 있으며 예술과 지식을 추구하기도 합니다. <BR>', 'I07', '9');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '속을 알 수 없는 부분이 있습니다. 자신에 대한 이야기를 잘 하지 않는 편이며, 혼자 고민을<BR>해결하고자 하거나 속으로 삭이려는 부분이 많습니다. 별로 중요하지도 않지만 비밀에 붙이기<BR>도 하지만 믿는 사람에게는 거리낌 없이 중요한 이야기를 털어 놓기도 합니다. <BR><BR>겉으로는 잘 들어나지 않지만 쉽게 낮선 것에 대해 적응을 하기 어려워 하기도 합니다. 캬멜레<BR>온과 같은 모습을 보이기도 합니다. ', 'J08', '10');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '<P>무엇이든 한번에 많은 것을 얻어 낼 수 있는 것을 좋아 한다고 볼 수 있겠습니다. 대체적으로 <BR>효율성에 관한 감각이 좋은 편이기 때문에 한 번에 끝낼 것을 여러 번 다시 손대는 것을 싫어<BR>하므로 일면 게을러 보일 수도 있습니다. <BR><BR>학습의 방법 또한 한 번에 암기하는 것이나 작심하고 순간적인 집중력으로 일순간에 고득점을 <BR>노리기도 합니다. 뒤늦게 학업의 욕심을 내는 경우도 있으니 필요하다 싶으면 시기를 가리지 <BR>않습니다. 계산력이 뛰어나며 판단력이 뛰어납니다.</P>', 'A09', '11');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '다소곳하며 조용하고 차분한 성격으로 약간 보수적인 듯 한 기색이 보이는 성격입니다. 다만 <BR>친한 사람들과는 스스럼 없이 잘 어울리며 의외의 모습을 보이기도 하는 편입니다. 낮가림이 <BR>다소 있는 편입니다. <BR><BR>때로는 소심한 조숙하여 보이기도 하지만 때로는 아이와 같은 천진함을 나타내는 모습이 특징<BR>이라 할 수 있으며 때때로 산만하여 혼자 사색에 잠기는 면도 더러 있겠습니다. ', 'B10', '12');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '화끈한 성격과 함께 침착한 이면이 있습니다. 개인적인 상황에서는 화끈하고 낙천적인 활동적<BR>인 면이 강하게 나타나는 편이지만 업무나 공적인 상황에서는 침착하고 신중한 모습을 보여주<BR>는 편입니다. 대의와 단체생활에 적합한 기질을 가지고 있으며, 자신보다 약한 대상을 보호하<BR>고자 하는 의협심을 가지고 있기도 합니다. ', 'C11', '13');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '약간 산만한 편이라거나 다양한 분야에 호기심이 많다고 할 수 있겠습니다. 감수성이 예민한 편<BR>기 때문에 감정의 변화가 다소 있는 편이라 할 수 있겠습니다. 변화에 따라 다양한 모습을 가진<BR>캬멜레온 같은 면이 있다 할 수 있겠습니다. ', 'D12', '14');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '완고하고 강직한 성품으로 완벽주의적인 면과 강한 승부근성을 가지고 있습니다. 다만 스스로<BR>자신감을 가지지 못하는 부분에 있어서는 다가서기까지 시간을 필요로 하는 편이라 할 수 있<BR>습니다. 약한 이를 돌봐주고 대의를 위해 나서는 등의 의로운 기상이 있다 할 수 있으며 리더<BR>쉽과 함께 대범한 면이 엿보입니다.&nbsp; ', 'E01', '15');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '<P>외부에 대한 경계가 기본적으로 있는 편이며 내성적인 기질이 없지 않지만, 필요에 따라서는<BR>반대적인 성향을 보여주는 변화의 폭이 의외로 큰 편입니다. <BR><BR>이러한 기질은 일상에서는 내성적이다가 외부와 접촉당시나 활동의 필요성에 따라 나타난다 <BR>할 수 있겠습니다. 배려심도 많지만 옳다고 생각하는 일에 대해선 고집을 꺽지 않는 완고한 면<BR>도 있겠습니다. </P>', 'F02', '16');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '낙천적이며 긍정적인 사고의 소유자입니다. 주변사람과 어울리기 좋아하는 편이며 기분파입니<BR>다. 약간의 다혈질적인 면도 있기 때문에 낙관적이고 여유로운 편이기도 하다가 급해지면 화끈<BR>한 기질을 나타내기도 합니다. <BR><BR>매사가 끈기가 있고 재주가 뛰어나며 외교 수완에 능수능란하고 다방면에 경험과 지식이 풍부<BR>하나 고집이 강하고 매사에 급히 서두르는 단점이 있습니다.', 'G03', '17');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '<P>자비심이 있고 외유내강하나 신경이 예민하고 자존심이 강합니다. 분석력이 뛰어나고 매사에 <BR>세밀하며 의리를 중히 여기는 심성이면서도 냉정한 면이 있습니다. </P>
insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '아기자기한 성격에 안정적인 것을 선호하며 보기보다 겁이 많아 보이기도 합니다. 소심해서라<BR>기보다 안정적인 것에 대해 먼저 생각하기 때문입니다. 사소한 것이라도 중요하게 생각하며 기<BR>본적인 것을 중요시 합니다. <BR><BR>모험이나 위험요소에 대해서 꺼리며 가정적인 것을 선호합니다. 건강과 일상생활의 풍요를 중<BR>요하게 생각합니다.', 'I05', '19');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '다소 소심하여 끈기가 부족한 단점이 있고 공상을 즐기는 경향이 있습니다. 그러나 한 번 목표<BR>가 정해지면 끝까지 자기의 집념을 추구하면서 어떠한 장애에도 굴복하지 않고 견디어 내는 내<BR>성을 타고 났기 때문에 우직하게 성공하는 케이스가 많습니다.', 'J06', '20');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '고지식하고 신경이 예민하면서도 정이 많습니다. 한번 남을 믿으면 끝까지 믿지만 한번 싫은 <BR>사람은 죽어도 돌아보지 않는 강한 고집이 있으며 추진력이 강합니다. <BR>', 'A07', '21');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '<P>매사에 자립적이고 두뇌가 명석하고 센스가 빠릅니다. 외강내유한 성품에 감성이 풍부하고 낭<BR>만적이나 다소 독선적이고 직선적이라 손해를 보는 경향도 있습니다. </P>
insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '약간의 다혈질적인 면이 있습니다. 낙천적이기도 하지만 분을 쉽게 삭이지 못해 잠을 이루지<BR>못하는 경우도 간간히 있는 편이며 오행의 화기운이 강하기 때문에 다소 급한 편이라 할 수 <BR>있겠습니다. <BR>', 'C09', '23');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '온화하고 매사에 착실하며 상냥하여 대인 관계가 원만하며 치밀하고 세심합니다. 미적 감각이 <BR>뛰어나고 감성이 풍부하나 잔소리가 많을 수 있고 남의 일에 간섭을 많이 하는 경향이 있습니<BR>다. <BR><BR>원칙주의적인 면이 있기 때문에 다소 보수적이며 긴장하면 무뚝뚝하게 반응하는 편이라 할 수 <BR>있겠습니다. <BR>
insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '감수성이 예민한 편이며, 꼼꼼한 편이기 때문에 때로는 소심해 보이거나 까다롭게 보이기도 합<BR>니다. 은근히 감각적인 면이 있어 패셔너블한 재능과 아기자기한 것들을 좋아합니다. <BR><BR>이런 경우는 수집적인 취미를 가지기도 하며 자신의 물건에 대해 애착과 정성을 들입니다. 이<BR>성에게는 사소한 것 까지 잘 챙겨주는 센스티브한 매력의 소유자입니다. 
insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '의리를 중히 여기고 두뇌 회전이 명석하며 매사에 활동적이며 논리적이고 세련되며 깔끔합니<BR>다. 자기 자신의 일보다 남을 위해 희생할 줄 알며 자비심이 있고 정의감이 강합니다. 겉은 차가<BR>우나 내면은 온화하고 집념은 강하지만 체념이 빠릅니다. ', 'F12', '26');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '추리력과 계산력이 뛰어납니다. 그 기질 또한 자기 책임에 대한 한계는 분명하지만 때로는 자<BR>기의 고집만을 내세워 외부와의 경계를 차단시키는 독선적인 면을 배제할 수 없습니다. 판단력<BR>이 뛰어난 편이지만 주변의 의견을 조화롭게 받아들이도록 하여 원만한 결정과 행동이 따른다<BR>면 좀 더 안정감이 있을 것이라 할 수 있겠습니다. ', 'G01', '27');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '다재 다능한 능력이 있고 자존심이 강하며 업무를 분별하고 관철시키는 데 센스가 있으며 앞을<BR>내다보는 선견지명이 있습니다. 깔끔하나 강한 고집으로 독단 독선을 하기 쉽고 타인의 충고나<BR>조언을 귀담아 듣지 않는 단점이 있습니다. ', 'H02', '28');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '다소 괴팍하다거나 속을 알기 어려운 부분이 있습니다. 흔히 예술계통에 있는 사람을 보는 듯<BR>한 느낌이라 할 수 있겠으며, 때로는 외국사람처럼 사고방식의 차이를 보이기도 합니다. 실제로<BR>운명상 외국에서 장기간 거주할 수도 있는 운명이니 이런 경우는 적응이 빠르다 할 수 있겠습<BR>니다. <BR>', 'I03', '29');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '꼼꼼한 편이며 외로움을 많이 타는 편이지만 조심성이 강하기 때문에 낮선 사람을 경계하기도<BR>합니다. 깔끔한 성격에 사소한 것도 중요하게 생각하며 미리 준비하거나 예방하는 등의 준비성<BR>이 뛰어난 편입니다. 그러나 이런 부분이 지나쳐 약간의 결벽증을 보이는 경우도 있는 편입니<BR>다.', 'J04', '30');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '<P>센스와 재치가 빠르고 명랑하며 두뇌회전이 비상해 외교 수완이 뛰어납니다. 매사에 능동적이<BR>고 박력이 있으며 대인 관계에 처세가 원만하나 고집이 세고 다소 우유부단한 면도 있습니다.<BR><BR>낙천적이지만 감정의 기복이 크고 싫증을 빨리 낼 수 있으니 끈기를 기르면 더욱 완벽하다 하<BR>겠습니다. </P>', 'A05', '31');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '전체적으로 심성이 곱고 마음이 여리며 포용력을 가지고 있습니다. 그 기질 또한 온순한 듯하<BR>지만 대단히 야심적이고 난세에 대처할 수 있는 임기응변에 능합니다. 상황판단이 빠른 편이며<BR>성장을 위한 의욕이 대단하다 할 수 있겠습니다. <BR>', 'B06', '32');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '추리력과 계산력이 뛰어납니다. 그 기질 또한 자기 책임에 대한 한계는 분명하지만 때로는 자<BR>기의 고집만을 내세워 외부와의 경계를 차단시키는 독선적인 면을 배제할 수 없습니다. 판단력<BR>이 뛰어난 편이지만 주변의 의견을 조화롭게 받아들이도록 하여 원만한 결정과 행동이 따른다<BR>면 좀 더 안정감이 있을 것이라 할 수 있겠습니다. ', 'C07', '33');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '꼼꼼한 면이 발달하였으면서 눈치가 빠르며 순발력이 좋다 할 수 있습니다. 다만 평소에는 움직<BR>이기 싫어하는 편이며 효율적인 것을 좋아하며, 까다로운 면이 있어서 경우에 따라서는 결벽증<BR>도 없지 않습니다. ', 'D08', '34');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '강직하고 자기 주관이 뚜렷하지만 결정에는 다소 시간이 걸리는 편이기 때문에 우유부단하다는<BR>오해를 받을 수도 있습니다. <BR><BR>일단 결정되면 자신의 생각을 확인해 보기 위해 주변사람들로 부터 물어도 보지만 이미 결정은 <BR>되어 있기 때문에 부드러운 듯 하지만 고집이 센 편이며 자존심이 강한 편이기 때문에 타인에<BR>게 쉽게 굴복하려 하지 않습니다. ', 'E09', '35');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '조심성이 많은 편이며 다소 외로움을 많이 타는 편입니다. 까다로우면서도 정이 많은 편이기 <BR>때문에 친한 사람에게 성질을 잘 내며, 곧 후회하는 모습이 있습니다. 꼼꼼하며 알찬 것을 추<BR>구하는 편이라서 생활력이 강하며 정이 많습니다. ', 'F10', '36');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '<P>쾌활하며 낙천적인 기질이 강한 편입니다. 책임감이 강한 편이지만 개인적으로는 감정기복이 <BR>심한 편이기 때문에 쉽게 싫증을 느끼고 새롭고 흥미로운 것을 선호하는 편입니다. 그러므로<BR>승부욕을 느끼거나 책임감에 의해 오기가 발동하면 의외의 매우 좋은 결과를 낳기도 합니다.</P>', 'G11', '37');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '다소 수동적이며 낮가림이 없지 않지만 편안한 상황에서는 쾌활한 모습을 보여주는 정도입니<BR>다.<BR><BR>대개 첫 만남에서 보이는 모습과 익숙해 진 다음에 보이는 모습은 상대적으로 다르다 할 수 있<BR>겠습니다. 부드럽고 유약해 보이기도 하지만 위급한 상황에 처하면 의외의 차분함과 신중함을<BR>보여주며 의연하고 지혜롭게 대처한다 하겠습니다. ', 'H12', '38');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '<P>낙천적이며 여유로운 기질에 해당하므로 대개 긍정적인 사고로 활동적인 삶을 추구한다 할 수 <BR>있겠습니다. 대범하며 주변 사람을 돕고자 하는 마음이 있어 아랫사람에게 잘 해 주는 편이라<BR>할 수 있겠습니다. 다만 급한 상황에서도 여유롭게 행동하는 편이라 주변 사람이 답답할 수도<BR>있겠습니다.&nbsp; </P>', 'I01', '39');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '안정적이고 여유로운 성격에 후한 인심을 가지고 있지만 때때로 토라지고 소심해지는 일면도 <BR>있겠습니다. 아랫사람에게 잘 대해 주는 편이며 낙천적이고 긍정적인 삶을 지향한다 할 수 있겠<BR>습니다. ', 'J02', '40');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '추리력과 계산력이 뛰어납니다. 그 기질 또한 자기 책임에 대한 한계는 분명하지만 때로는 자<BR>기의 고집만을 내세워 외부와의 경계를 차단시키는 독선적인 면을 배제할 수 없습니다. 판단력<BR>이 뛰어난 편이지만 주변의 의견을 조화롭게 받아들이도록 하여 원만한 결정과 행동이 따른다<BR>면 좀 더 안정감이 있을 것이라 할 수 있겠습니다. ', 'A03', '41');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '자기주장이 확실한 편이며 상황에 대한 대처능력이 뛰어난 편입니다. 이성적이고 논리적으로<BR>보여지기도 하지만 감수성이 예민하여 충동적이거나 감정의 물결에 휩싸이기도 합니다. 목적<BR>을 달성하기 위한 의욕이 대단하다 할 수 있겠으며 욕심이 대단한 듯 보이지만 자신의 것이 <BR>아니라 생각되면 미련없이 포기하는 편이라 할 수 있습니다. 현실적인 지혜가 뛰어난 편입니<BR>다. ', 'B04', '42');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '급한 성격의 소유자로 강한 승부욕과 저돌적인 행동력이 장점이기도 하지만 때로는 단점이 되<BR>기도 합니다. 문제해결을 위한 노력과 행동은 감탄스러울 정도의 역량을 보여주지만 신중한<BR>판단과 인내를 요구하는 상황에서는 상대적인 취약점이 있기도 합니다. ', 'C05', '43');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '낙천적이고 친절한 성격이지만 의외의 강한 면을 내포하고 있으므로 절대 약한 성격은 아니지만<BR>부드러운 이미지로 인해 유약해 보일 수는 있겠습니다. 꼼꼼하고 차분한 편이기 때문에 일상적으<BR>로 생활력은 강하지만 정이 많은 편이기 때문에 손해를 보는 편이기도 합니다.', 'D06', '44');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '센스와 재치가 빠르고 명랑하며 두뇌회전이 비상해 외교 수완이 뛰어납니다. 매사에 능동적이<BR>고 박력이 있으며 대인 관계에 처세가 원만하나 넉넉하고 긍정적인 기질로 인해 지나치게 여<BR>유롭게 행동하는 경우가 더러 있겠습니다. ', 'E07', '45');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '온화하고 매사에 착실하며 상냥하여 대인 관계가 원만하며 치밀하고 세심합니다. 미적 감각이 <BR>뛰어나고 감성이 풍부하나 잔소리가 많을 수 있고 동료나 친구사이에 있어서도 가르치려는 자<BR>세를 가질 수 있습니다. <BR>', 'F08', '46');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '자유분방함과 낙천적인 기질을 가지고 있지만 단체생활이나 활동적인 상황에서는 협조적인 면<BR>이 잘 발달 해 있습니다. 다소 우월감이 있어 자신감이 지나친 면이 있지만 노력이 필요하다<BR>느끼면 오기가 발동하여 열심히 노력하기도 합니다. ', 'G09', '47');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '여러사람에게 친절하게 대하며 웃음이 많은 낙천적인 기질이 발달해 있는 편입니다. 그러나 편<BR>한 사람이나 절친한 사람에게 화풀이를 한 다음 곧 후회하기도 하는 면이 있습니다. 기분파이기<BR>때문에 뒤끝은 없는 편이며 언변이 유창한 편입니다. ', 'H10', '48');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '여유로울 때는 한없이 여유로운 편이지만 상황이 시급해지면 누구보다 서두르는 편입니다. 상<BR>황에 맞춰 변화와 컨트롤이 발달해 있는 편이니 컨디션에 따라 슬럼프를 잘 관리해야 합니다.<BR>승부욕이 강한 편이며 감각이 발달해 있으므로 육감이나 눈치가 빠른 편이기도 합니다. ', 'I11', '49');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '신중하며 꼼꼼한 편이지만 때때로 건망증이 있어 의외의 모습이 나타나기도 합니다. 고집과 강<BR>단이 강한 편이며 예의와 에티켓을 중요하게 생각하는 편이므로 윗사람을 잘 따르는 편이기도<BR>하며, 아랫사람을들 잘 리드하는 편이기도 합니다. ', 'J12', '50');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '자신감이 강한 편이며 주관이 뚜렷한 편입니다. 때로는 이러한 고집이 강해 주변사람의 의견<BR>을 무시하는 면도 없지 않다 할 수 있겠습니다. 그러나 대인관계는 오히려 폭이 넓은 편이며<BR>리더쉽이 있는 편이므로 사회적으로 빨리 적응하는 스타일입니다.&nbsp;<BR> ', 'A01', '51');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '다재 다능한 능력이 있고 자존심이 강하며 업무를 분별하고 관철시키는 데 센스가 있으며 앞을<BR>내다보는 선견지명이 있습니다. 깔끔한 것을 좋아하고 예민한 편이라 까다로운 면도 더러 나타<BR>나는 편이라 할 수 있겠습니다. ', 'B02', '52');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '공상, 상상력이 풍부한 편이며 낙천적이지만 성격은 다소 급한 편이라 할 수 있겠습니다. 분명<BR>하고 확실한 것을 좋아하는 편이며 때때로 감상적이고 정서적인 환경에 젖어들기도 하는 감수<BR>성이 풍부한 편입니다. <BR>', 'C03', '53');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '평상시에는 여유롭고 유순한 편이지만 한 번 목표가 정해지면 맹렬히 돌진하기도 하는 예리함이<BR>잘 발달해 있으나 지구력이 약한 편이므로 마치 단거리선수와 같은 순발력이 장점이라 할 수 있<BR>겠습니다. 치밀한 계산력과 오기를 통해 어려운 난관을 쉽게 넘어서기도 하지만 자존심을 지키<BR>기 위해 손해를 보는 편이기도 합니다. ', 'D04', '54');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '때로는 과격하고 의욕적이기도 하며 저돌적이지만 하나의 계획을 실현하기 위해 상당한 시간을<BR>보내기도 하는 지나친 신중함을 가지고 있기도 합니다. 다만 승부욕이 강하기 때문에 필요에 <BR>따라 배수진을 치고 적극성을 보이기도 합니다. ', 'E05', '55');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '온순한 성격이지만 남에게 지기 싫어하며 간섭받는 것도 꺼려 하는 편이라 할 수 있겠습니다.<BR>또한 호기심이 강한 편이지만 싫증도 쉽게내는 편이기 때문에 다방면에 걸쳐 이해력이 빠른 반<BR>면 끈기를 길러야 할 필요성이 있다 할 수 있겠습니다. ', 'F06', '56');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '센스와 재치가 빠르고 명랑하며 두뇌회전이 비상해 외교 수완이 뛰어납니다. 매사에 능동적이<BR>고 자신감이 넘친다 할 수 있겠습니다. 지나친 솔직함이 있어서 감정을 감추는 것이나 절제,<BR>말을 아끼는 것에 대해 좀 더 노력해야 할 것입니다. <BR>', 'G07', '57');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '<P>쾌활하며 긍정적인 기질의 소유자이지만 확실한 것을 좋아하는 칼 같은 예리함도 겸비한 성격<BR>이라 할 수 있겠습니다. 대체적으로 자신 주변으로 친한 사람을 가까이 두려는 소수정예의 인<BR>간관계를 추구하는 편이며 생활력이 강한 노력파라 할 수 있겠습니다. <BR><BR>다만 호기심이 강한 편이지만 감각적이기 때문에 다방면에 걸쳐 관심을 두는 경우가 많은 편입<BR>니다. 한 군데로 집중할 수만 있다면 무서운 결과를 내기도 합니다.&nbsp; </P>', 'H08', '58');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '다소 쉽게 긴장하는 편이며 노력형입니다. 외양적으로는 자신감에 차 있는 듯 하지만 처음엔 <BR>확신을 가지지 못하는 신중함을 엿보이기도 합니다. 확실한 것을 좋아하는 편이며 대체적으로<BR>처음엔 느리지만 마무리엔 노련하고 확실한 추진력을 보이기도 합니다. ', 'I09', '59');insert into S072(DB_check, DB_data, DB_express, DB_num) values('Y', '<P>긍정적이고 밝은 성격을 엿볼 수 있지만 혼자일 때에는 센티멘탈한 면도 가지고 있기도 합니<BR>다. 대체적으로 여유로운 기질이 강한 편이기 때문에 완만한 흐름으로 여유와 함께 노력을 하<BR>는 편이므로 비유하자면 토끼와 거북이중에 거북이와 같다 할 수 있겠습니다. </P>
